-- 建議建立的索引
CREATE INDEX IF NOT EXISTS idx_taiwan_foods_category ON diet_daily_foods(category) WHERE taiwan_origin = true;
CREATE INDEX IF NOT EXISTS idx_taiwan_foods_name ON diet_daily_foods(name) WHERE taiwan_origin = true;
CREATE INDEX IF NOT EXISTS idx_taiwan_foods_verification ON diet_daily_foods(verification_status) WHERE taiwan_origin = true;
CREATE INDEX IF NOT EXISTS idx_taiwan_foods_condition_scores ON diet_daily_foods USING GIN(condition_scores) WHERE taiwan_origin = true;

-- 統計查詢
SELECT
    category,
    COUNT(*) as food_count,
    AVG(calories) as avg_calories,
    AVG(protein) as avg_protein
FROM diet_daily_foods
WHERE taiwan_origin = true AND verification_status = 'admin_approved'
GROUP BY category
ORDER BY food_count DESC;
